    room.sendAnnouncement('Desbanear a todos los jugadores baneados: `!clearbans`', player.id, 0xffe400, "small", 0);

    room.sendAnnouncement('S I L E N C I A R -- Y  -- D E S M U T E A R 🔇', player.id, 0xffe400, "bold", 0);
    room.sendAnnouncement('Mutear jugador: `!mute + Nickname`', player.id, 0xffe400, "small", 0);
    room.sendAnnouncement('Desmutear jugador: `!unmute + Nickname`', player.id, 0xffe400, "small", 0);
    room.sendAnnouncement('Desmutear a todos los jugadores muteados: `!unmuteall`', player.id, 0xffe400, "small", 0);
    room.sendAnnouncement('Silenciar palabras: `!silenciar + palabra`', player.id, 0xffe400, "small", 0);
    room.sendAnnouncement('Desilenciar palabras: `!desilenciar + palabra`', player.id, 0xffe400, "small", 0);

    room.sendAnnouncement(' M O D O -- J U E G A N -- T O D O S 🎮', player.id, 0xffe400, "bold", 0);
    room.sendAnnouncement('Activar modo "Juegan Todos": `!juegantodos`', player.id, 0xffe400, "small", 0);
