function changeOurSize(player, message){
    const DEFAULT_SIZE = 15;
    const MIN_SIZE = TamanoMinimoPermitido
    const MAX_SIZE = TamanoMaximoPermitido
    const ACCELERATION_FACTOR = 5; //1.15
    const KICK_STRENGTH_FACTOR = 5;//1.15;
	//room.sendAnnouncement("FUERZA JUG1: " + player.kickStrength);
    if (player.team !== 0 && !tookASize.hasOwnProperty(player.id)){
        let size = message.substr("!size ".length);
        if (!isNaN(size) && size >= MIN_SIZE && size <= MAX_SIZE){
            let acceleration = player.acceleration;
            let kickStrength = player.kickStrength;
			//room.sendAnnouncement("FUERZA JUG2: " +kickStrength);
            if (size < DEFAULT_SIZE) {
                acceleration *= ACCELERATION_FACTOR;
            } else if (size > DEFAULT_SIZE) {
                kickStrength *= KICK_STRENGTH_FACTOR;
            }
            room.setPlayerDiscProperties(player.id, {radius: size, invMass: size / 30, acceleration: acceleration, kickStrength: kickStrength});
            tookASize[player.id] = size;
        } else {
	room.sendAnnouncement("📏 ¡Elige el tamaño de tu jugador! 🏀\n\nElige un número entre " + MIN_SIZE + " y " + MAX_SIZE + " para ajustar el tamaño de tu jugador. Recuerda que cuanto más pequeño sea el número, más pequeño será tu tamaño. El tamaño normal por defecto es 15.\n\n¡Diviértete jugando! 🎉", player.id, 0xbfff35, "normal", 0);
       }
    } else {
	room.sendAnnouncement("🔄 ¡Puedes cambiar tu tamaño una sola vez por partido! ⚽️\n\nRecuerda que solo puedes ajustar tu tamaño una vez. Así que elige sabiamente cuando decidas cambiarlo. ¡Diviértete jugando y aprovecha tu única oportunidad! 🎉", player.id, 0xbfff35, "normal", 0);
    }
    return false;
}

