function buscarJugadorEnPartida(idJugador){
	for (var i = 0 ; i < listaJugadoresEstadisticasEnPartida.length ;i++){
		var jugador = listaJugadoresEstadisticasEnPartida[i].jugador
		if(idJugador == jugador.id){
			return listaJugadoresEstadisticasEnPartida[i];
		}
	}
	return null;
}
function aumentarGolJugador(idJugadorAumentarGol){
	for (var i = 0; i < listaJugadoresEstadisticas.length; i++) {
		var jugador = listaJugadoresEstadisticas[i].jugador;
		if (jugador.id === idJugadorAumentarGol) {
		  listaJugadoresEstadisticas[i].estadisticas.goles += 1;
		  return false; 
		}
	}
	return true;
}

function aumentarAutogolJugador(idJugadorAumentarGol){
	for (var i = 0; i < listaJugadoresEstadisticas.length; i++) {
		var jugador = listaJugadoresEstadisticas[i].jugador;
		if (jugador.id === idJugadorAumentarGol) {
		  listaJugadoresEstadisticas[i].estadisticas.autogoles += 1;
		  return false; 
		}
	}
	return true;
}
function aumentarAsistenciaJugador(idJugadorAumentarGol){
	for (var i = 0; i < listaJugadoresEstadisticas.length; i++) {
		var jugador = listaJugadoresEstadisticas[i].jugador;
		if (jugador.id === idJugadorAumentarGol) {
		  listaJugadoresEstadisticas[i].estadisticas.asistencias += 1;
		  return false; 
		}
	}
	return true;
}

function ordenarJugadoresPorMasGoles() {
    // Crear una copia del array original utilizando slice() o el operador spread (...)
    var copiaListaJugadoresEstadisticas = listaJugadoresEstadisticas.slice(); // O también: [...listaJugadoresEstadisticas]

    copiaListaJugadoresEstadisticas.sort(function (a, b) {
        // Ordenar por la cantidad de goles de mayor a menor
        return b.estadisticas.goles - a.estadisticas.goles;
    });
	return copiaListaJugadoresEstadisticas;
    // Ahora copiaListaJugadoresEstadisticas está ordenada por la cantidad de goles de mayor a menor
}
function ordenarJugadoresPorMasAsistencias() {
    // Crear una copia del array original utilizando slice()
    var copiaListaJugadoresEstadisticas = listaJugadoresEstadisticas.slice();

    copiaListaJugadoresEstadisticas.sort(function (a, b) {
        // Ordenar por la cantidad de asistencias de mayor a menor
        return b.estadisticas.asistencias - a.estadisticas.asistencias;
    });
	return copiaListaJugadoresEstadisticas;
    // Ahora copiaListaJugadoresEstadisticas está ordenada por la cantidad de asistencias de mayor a menor
}
function actualizarKDAJugadorEnPartida(jugador){
	var estadisticas = jugador.estadisticas;
	estadisticas.kda = estadisticas.goles + estadisticas.asistencias - estadisticas.autogoles;
}
